import React from 'react';

const ResultsComponent = ({ report }) => {
  const attributes = report && report.data && report.data.attributes ? report.data.attributes : {};
  const { date, last_analysis_stats, total_votes } = attributes;

  return (
    <div className="results-container">
      {date ? (
        <div className="report-details">
          <h3>Report Date: {new Date(date * 1000).toLocaleString()}</h3>
          <div className="analysis-stats">
            <h4>Analysis Stats:</h4>
            <p>Harmless: {last_analysis_stats?.harmless ?? 'N/A'}</p>
            <p>Malicious: {last_analysis_stats?.malicious ?? 'N/A'}</p>
            <p>Suspicious: {last_analysis_stats?.suspicious ?? 'N/A'}</p>
            <p>Undetected: {last_analysis_stats?.undetected ?? 'N/A'}</p>
          </div>
          <div className="total-votes">
            <h4>Total Votes:</h4>
            <p>Harmless: {total_votes?.harmless ?? 'N/A'}</p>
            <p>Malicious: {total_votes?.malicious ?? 'N/A'}</p>
          </div>
        </div>
      ) : (
        <p>No report data available</p>
      )}
    </div>
  );
};

export default ResultsComponent;
